declare const SQL_QUERY = "\nUPDATE OR IGNORE Returns SET\n  \"party\" = IFNULL(\"party\", @party), \"rank\" = IFNULL(\"rank\", @rank), \"tally\" = IFNULL(\"tally\", @tally), \"contestId\" = IFNULL(\"contestId\", @contestId), \"turfId\" = IFNULL(\"turfId\", @turfId)\nWHERE\n  \"contestId\" = @contestId AND \"turfId\" = @turfId AND \"party\" = @party AND \"rank\" = @rank\n";
export default SQL_QUERY;
